#include<stdio.h>
extern int add(int);
extern int sub(int);
extern int sum(int, int);

main() {
    int ret1, ret2, ret3;
    ret1 = add(5);
    ret2 = sub(5);
    ret3 = sum(ret1, ret2);
    printf("\nret from add() = %d", ret1);
    printf("\nret from sub() = %d", ret2);
    printf("\nret from sum() = %d", ret3);
}

int add(int arg) {
    arg++;
    return arg;
}

int sub(int arg) {
    arg--;
    return arg;
}

int sum(int arg1, int arg2) {
    return (arg1 + arg2);
}

